import React from 'react';
const User = () => {
    return (
      <div>
      <table id="myTable">
      <tr>
      <th>Id</th>
      <th>Name</th>
      <th>User Name</th>
      </tr>
      <tr>
      <td></td>
      </tr>
      </table>
      </div>);
    }
    export default User;
